import React, {Component} from "react";
import {Container, Row} from "reactstrap";
import Card from "./Card";

class GitDescription extends Component {
  constructor(props) {
    super(props);
    this.state = {
      people: [
        {
          logo: require("./images/html-5.svg"),
          name: "HTML",
          id: '1'
        }, {
          logo: require("./images/css-3.svg"),
          name: "CSS",
          id: '2'
        }
      ]
    };
  }
  render() {
    return (
      <div class="container-fluid" style="margin: 0.25vmax 0; display: flex;">
        <div class="row" style="padding: 0 1.5vmax">
          {this.state.people.map((person, i) => ( <Card key={i} person={person} /> ))}
      </div>
    </div>
  );
 }
}

export default GitDescription;
